- input: "TEXT\x1CC00031088\x1C1\x1C\x1CF3XA\x1CThis amendment has been filed in response
    to the RFAI referencing the 30 Day Post General Report.  1) This report has been
    amended to include adequate employer/occupation entries for the items listed in
    the RFAI. 2) The first transfer to the non-federal account (for 5,000) was the
    transfer-out of a mis-deposit.  The contribution from Sudhir Signh received on
    10/31/12 was intended for the non-federal account and mistakenly deposited into
    the federal account.  The transfer-out of this contribution was made on 11/1/12.
    The second transfer, for $4,500 was a transfer made to the non-federal account
    for state activity and was not made to finance activity in connection with a federal
    election or made to influence the election or defeat of a specific candidate for
    federal office. 3) Payments on H6 for GOTV Calls were not public communications
    as defined by 11 CFR 100.26 and did not refer to any clearly identified federal
    candidate or contain express advocacy.  4) The transfers from the RNC were not
    used as the federal component of any expenditure for Federal Election Activity.
    Furthermore, the federal component of expenditures allocated between federal and
    Levin funds were raised by the committee. The transfers from the RNC total 63,000
    while the Federal Election Activity paid entirely with federal funds totals 21,771.42
    and the federal portion of allocated Federal Election Activity totals 45,579.38,
    while the Committees federal contributions received total 171,305.90 for the period.
    \ Therefore the committees cash position was adequate to ensure no transferred
    funds were used to pay for this activity. 5) Payments on Schedule H6 for Reimbursements
    for GOTV Activities and Reimbursements of GOTV Activities were not reimbursements,
    but were payments for GOTV services. These individuals are not employees of the
    committee.  The report has been amended to include adequate purposes for these
    disbursements.  GOTV calls were not public communications as defined by 11 CFR
    100.26 and did not refer to any clearly identified federal candidate or contain
    express advocacy.  6) The report has been amended so that Columns A and B, Line
    11 of the Schedule L Aggregation Page are equal.  7) The report has been amended
    so that the Schedule L Aggregation Page discloses positive ending Cash-on-Hand.
    8) The report has also been amended to correctly show all expenditures on H4 as
    allocated between federal and non-federal funds. Furthermore, No employee whose
    salary or benefits appears on schedule H4 spent more than 25 percent of their
    compensated time on Federal Election Activity this month.\n"
